import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';


function App() {
  return (
    <section>

      <NavBar />


      <Router>

          <Route path="/cadastros" exact component={<PageCadastros/>} />



      </Router>

      <PageCadastros />



      <nav>
        <Formulario />
      </nav>



    </section>
  );
}

export default App;
